trait CommandCallback { type Error: Into<JumiaError>; async fn call(&self, ctx: &Context, interaction: &Interaction, args: &CommandArgs) -> Result<(), Self::Error>;
} impl<E, F, G> CommandCallback<E> for F where E: Into<JumiaError>, F: Fn(&Client, &Interaction, &CommandArgs) -> G, G: Future<Output = Result<(), E>>,
{ type Error = E; async fn call(&self, ctx: &Context, interaction: &Interaction, args: &CommandArgs) -> Result<(), E> { self(ctx, interaction, args) }
} // either library or user code
trait GuildOnly<F: CommandCallback> { fn guild_only(callback: impl CommandCallback) -> F;
} impl<E: Into<JumiaError>, C: CommandCallback<E>, F: CommandCallback> GuildOnly<F> for C
{ fn guild_only(self) -> F { |ctx, interaction, args| async move { if interaction.guild_id.is_none() { interaction.reply(ctx, "Command must be run in guild").await?; } else { callback(ctx, interaction, args).await?; } } }
} // user code
async fn echo_command(ctx: Context, interaction: Interaction, args: CommandArgs) -> Result<(), BotError> { interaction.reply(ctx, args.get_string("text")).await?; Ok(())
} fn example() { Client::builder() .command( // there could probably be a better way of formatting this, but for now it's good enough CommandBuilder::new() .name("echo") .option(OptionBuilder::new() .name("text") .kind(OptionKind::String)) .callback(echo_command.guild_only()) );
}

